import Container from "react-bootstrap/Container";
import Badge from "react-bootstrap/Badge";

const Cafe = () => {
  return (
    <main className="App-home">
      <Container>
        <Row className="py-4 my-4">
          {/* <div>Cafe page - coming soon</div> */}
          <p>
            In Tokyo, Japan, you can enjoy a Gengar's Confuse Ray Smoothie or
            Snorlax's Tummy Filling Nap Lunch Plate at the Pokemon Cafe.
          </p>
        </Row>
        <Row className="py-4 my-4">
          <Badge bg="primary">
            <h4>Info Coming Soon!</h4>
          </Badge>
        </Row>
      </Container>
    </main>
  );
};

export default Cafe;
